export const SET_LIBRARY_DATA = 'SET_LIBRARY_DATA';

export function setLibraryData (data) {
  let payload = [].concat(data.books, data.magazines).map((item) => {
    {item.authors.split(',').map((item) => {
      let author = {};
      for (let i = 0; i < authors.default.length; i++) {
        if (authors.default[i].email === item) {
          author = authors.default[i];
          break;
        }
      }

      return (
        <>
          <div>
            {author.firstname} {author.lastname}
          </div>
        </>
      );
    })}
  });
  return {
    type: SET_LIBRARY_DATA,
    payload
  }
}
